import React from "react";
import { IonSlides, IonSlide, IonCardTitle, IonImg } from "@ionic/react";

const SlideShow = () => {
  const slides = [
    {
      id: 0,
      url: ""
    },
    {
      id: 1,
      url: ""
    },
    {
      id: 2,
      url: ""
    },
    {
      id: 3,
      url: ""
    },
    {
      id: 4,
      url: ""
    }
  ];
  return (
    <IonSlides>
      {slides.map(({ id }) => (
        <IonSlide key={id}>
          <IonCardTitle>{id}</IonCardTitle>
          <IonImg src={url} />
        </IonSlide>
      ))}
    </IonSlides>
  );
};

export default SlideShow;
